import axios from 'axios';
import { useEffect, useState } from "react";
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import $ from 'jquery';

const url = "http://localhost:5000";
function AddLocPage() {
    axios.get(url + "/api/location/types", {
        headers: {
            "Content-Type": `application/json`,
        }
    }).then((res) => {
        
        var data = res.data;
        var innerHTML = "<option>위치 타입 선택</option>";
        for(var i=0; i<data.length; i++){
            innerHTML += "<option value='" + data[i].loctype_id + "'>" + data[i].loctype_name + "</option>";
        }

        $(".selectbox").html(innerHTML);
    })

    useEffect(()=>{
        
    })
    
  return (
    <div className='m-5'>
    <Form>
        <Form.Select aria-label="Default select example" className='selectbox'>
        <Form.Label>위치 타입</Form.Label>
        <option value="1">One</option>
        <option value="2">Two</option>
        <option value="3">Three</option>
        </Form.Select>
        <br/>
        <Form.Group className="mb-3" controlId="formBasicPassword">
            <Form.Label>위치명</Form.Label>
            <Form.Control type="text" placeholder="위치명입력" />
        </Form.Group>
        <Form.Group className="mb-3" controlId="formBasicPassword">
            <Form.Label>위치 포인트</Form.Label>
            <Form.Control type="text" placeholder="위치 포인트 입력" />
        </Form.Group>
        <Form.Group className="mb-3" controlId="formBasicPassword">
            <Form.Label>위치 포인트</Form.Label>
            <Form.Control type="file" placeholder="위치 포인트 입력" />
        </Form.Group>
        
        <Button variant="primary" type="submit">
            Submit
        </Button>
    </Form>
    </div>
  );
}

export default AddLocPage;
